import React from 'react';
import '../styles/App.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ManageContacts from './ManageContacts';
import ManageCompanies from './ManageCompanies';
import ManageToDo from './ManageToDo';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={
          <div className="app">
            <Header />
            <div className="button-container">
              <Link to="/manage-companies"><button className="menu-button">Manage Companies</button></Link>
              <Link to="/manage-contacts"><button className="menu-button">Manage Contacts</button></Link>
              <Link to="/manage-todo"><button className="menu-button">Manage ToDo</button></Link>
            </div>
            <Footer />
          </div>
        } />
        <Route path="/manage-companies" element={<ManageCompaniesWithLayout />} />
        <Route path="/manage-contacts" element={<ManageContacts />} />
        <Route path="/manage-todo" element={<ManageToDoWithLayout />} />
      </Routes>
    </Router>
  );
}

function Header() {
  return (
    <header className="app-header">
      <h1>Welcome to the Capstone Matching System</h1>
      <h2>Welcome, Samuel Wade!</h2>
    </header>
  );
}

function Footer() {
  return (
    <footer className="app-footer">
      Â© 2023 Capstone Matching System
    </footer>
  );
}

function ManageCompaniesWithLayout() {
  return (
    <div>
      <Header />
      <ManageCompanies />
      <Footer />
    </div>
  );
}

function ManageToDoWithLayout() {
  return (
    <div>
      <Header />
      <ManageToDo />
      <Footer />
    </div>
  );
}

export default App;
